import React, { Component } from "react";
import "../fcss/main.css";
import "../fcss/material-design-iconic-font.min.css";
import "../fcss/daterangepicker.css";
import "../fcss/font-awesome.min.css";
import "../fcss/select2.min.css";

class BuyForm extends Component {
  state = {};

  buySearchButtonClick = () => {
    window.location.href = "/buy";
  };

  addBuyButtonClick = () => {
    window.location.href = "/buy/newBuy";
  };

  render() {
    return (
      <div>
        <div className="container">
          <header>
            <h2>
              <a href="/">
                <i className="ion-plane"></i> BLINK EXCHANGE
              </a>
            </h2>
            <nav>
              <ul>
                <li>
                  <a href="/sell" title="Sell">
                    Sell
                  </a>
                </li>

                <li>
                  <a href="/" title="Return to HOME Page">
                    Return to Home Page
                  </a>
                </li>
                <li>
                  <a href="/" title="LOG OUT">
                    LOG OUT
                  </a>
                </li>
              </ul>
            </nav>
          </header>
        </div>
        <body>
          <h1 align="center">Wanna Buy? </h1>

          <button onClick={this.buySearchButtonClick} className="btn third">
            Search from existing ones
          </button>
          <button onClick={this.addBuyButtonClick} className="btn fourth">
            Add a new item
          </button>
        </body>
      </div>
    );
  }
}

export default BuyForm;
